exports.find = function(id, done) {
  for (var i = 0, len = contacts.length; i < len; i++) {
    var contact = contacts[i];
    if (contact.id === id) {
      return done(null, contact);
    }
  }
  return done(null, null);
};

exports.findBydeviceID = function(deviceID, done) {
  var _ = require('undecsore');
  _.findWhere(devices, {deviceID: deviceID});
  return done(null, null);
};

exports.findByclientID = function(clientID, done) {
  var _ = require('undecsore');
  _.findWhere(devices, {clientID: clientID});
  return done(null, null);
};

exports.findByHostname = function(hostname, done) {
  var _ = require('undecsore');
  _.findWhere(devices, {name: hostname});
  return done(null, null);
};

exports.findByIP = function(ipAddr, done) {
  var _ = require('undecsore');
  _.findWhere(devices, {ipAddr: ipAddr});
  return done(null, null);
};

exports.findByTypeGroupID = function(typeGroupID, done) {
  var _ = require('undecsore');
  _.Where(devices, {typeGroupID: typeGroupID});
  return done(null, null);
};


